ads.description:
Dzień dobrym, mam do sprzedania samochód osobowy marki Mazda 5 wyprodukowany w 2006 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1998 cm3, legitymujący się mocą 143 KM, który pokonał do tej pory 256000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, lecz po wyżej 3tys obrotów odcina do I traci moc, nie reaguje przez parę sekund na pedal gazu, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Mazda prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane, wersja 7 osobowa.



Mazda jest wyposażenia w:

- Klimatyzację;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie i tylne;

- Elektryczne lusterka;

- 4 x airbag;

- 17 calowe alufelgi;

- Lodowej Światła do jazdy dziennej;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 06.04.2026 roku.

Przegląd techniczny BRAK.
